CREATE SCHEMA northwindib AUTHORIZATION DBA;

DROP TABLE IF EXISTS category;
CREATE TABLE category (
  CategoryID integer NOT NULL PRIMARY KEY GENERATED BY DEFAULT AS IDENTITY,
  CategoryName varchar(15) NOT NULL,
  Description varchar(2000),
  Picture blob,
  RowVersion integer DEFAULT '0' NOT NULL
);



DROP TABLE IF EXISTS comment;

CREATE TABLE comment (
  CreatedOn datetime NOT NULL,
  Comment1 varchar(2000),
  SeqNum tinyint NOT NULL,
  PRIMARY KEY (CreatedOn,SeqNum)
);


DROP TABLE IF EXISTS customer;

CREATE TABLE customer (
  CustomerID varchar(64) NOT NULL,
  CustomerID_OLD char(5) DEFAULT NULL,
  CompanyName varchar(40) NOT NULL,
  ContactName varchar(30) DEFAULT NULL,
  ContactTitle varchar(30) DEFAULT NULL,
  Address varchar(60) DEFAULT NULL,
  City varchar(15) DEFAULT NULL,
  Region varchar(15) DEFAULT NULL,
  PostalCode varchar(10) DEFAULT NULL,
  Country varchar(15) DEFAULT NULL,
  Phone varchar(24) DEFAULT NULL,
  Fax varchar(24) DEFAULT NULL,
  RowVersion integer DEFAULT NULL,
  PRIMARY KEY (CustomerID)
);

