  LastName varchar(30) NOT NULL,
  FirstName varchar(30) NOT NULL,
  Title varchar(30) DEFAULT NULL,
  TitleOfCourtesy varchar(25) DEFAULT NULL,
  BirthDate datetime DEFAULT NULL,
  HireDate datetime DEFAULT NULL,
  Address varchar(60) DEFAULT NULL,
  City varchar(15) DEFAULT NULL,
  Region varchar(15) DEFAULT NULL,
  PostalCode varchar(10) DEFAULT NULL,
  Country varchar(15) DEFAULT NULL,
  HomePhone varchar(24) DEFAULT NULL,
  Extension varchar(4) DEFAULT NULL,
  Photo blob,
  Notes varchar(2000),
  PhotoPath varchar(255) DEFAULT NULL,
  ReportsToEmployeeID integer DEFAULT NULL,
  RowVersion integer DEFAULT '0' NOT NULL,
  FullName varchar(62) NOT NULL,
  PRIMARY KEY (EmployeeID),
  KEY LastName (LastName),
  KEY PostalCode (PostalCode),
  KEY FK_Employee_Employee (ReportsToEmployeeID),
  CONSTRAINT FK_Employee_Employee FOREIGN KEY (ReportsToEmployeeID) REFERENCES employee (EmployeeID) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1415 DEFAULT CHARSET=utf8;

