DROP TABLE IF EXISTS order;

CREATE TABLE order (
  OrderID integer NOT NULL GENERATED BY DEFAULT AS IDENTITY,
  CustomerID varchar(64) DEFAULT NULL,
  EmployeeID integer DEFAULT NULL,
  OrderDate datetime DEFAULT NULL,
  RequiredDate datetime DEFAULT NULL,
  ShippedDate datetime DEFAULT NULL,
  Freight decimal(19,4) DEFAULT '0.0000',
  ShipName varchar(40) DEFAULT NULL,
  ShipAddress varchar(60) DEFAULT NULL,
  ShipCity varchar(15) DEFAULT NULL,
  ShipRegion varchar(15) DEFAULT NULL,
  ShipPostalCode varchar(10) DEFAULT NULL,
  ShipCountry varchar(15) DEFAULT NULL,
  RowVersion integer DEFAULT '0' NOT NULL,
  PRIMARY KEY (OrderID),
  KEY EmployeeID (EmployeeID),
  KEY EmployeesOrders (EmployeeID),
  KEY OrderDate (OrderDate),
  KEY ShippedDate (ShippedDate),
  KEY ShipPostalCode (ShipPostalCode),
  KEY FK_Order_Customer (CustomerID),
  CONSTRAINT FK_Order_Customer FOREIGN KEY (CustomerID) REFERENCES customer (CustomerID) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT FK_Order_Employee FOREIGN KEY (EmployeeID) REFERENCES employee (EmployeeID) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=186043 DEFAULT CHARSET=utf8;

