DROP TABLE IF EXISTS product;

CREATE TABLE product (
  ProductID integer NOT NULL GENERATED BY DEFAULT AS IDENTITY,
  ProductName varchar(40) NOT NULL,
  SupplierID integer DEFAULT NULL,
  CategoryID integer DEFAULT NULL,
  QuantityPerUnit varchar(20) DEFAULT NULL,
  UnitPrice decimal(19,4) DEFAULT '0.0000',
  UnitsInStock smallint(6) DEFAULT '0',
  UnitsOnOrder smallint(6) DEFAULT '0',
  ReorderLevel smallint(6) DEFAULT '0',
  Discontinued tinyint(1) DEFAULT '0' NOT NULL,
  DiscontinuedDate datetime DEFAULT NULL,
  RowVersion integer DEFAULT '0' NOT NULL,
  PRIMARY KEY (ProductID),
  KEY CategoriesProducts (CategoryID),
  KEY CategoryID (CategoryID),
  KEY ProductName (ProductName),
  KEY SupplierID (SupplierID),
  KEY SuppliersProducts (SupplierID),
  CONSTRAINT FK_Product_Category FOREIGN KEY (CategoryID) REFERENCES category (CategoryID) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT FK_Product_Supplier FOREIGN KEY (SupplierID) REFERENCES supplier (SupplierID) ON DELETE NO ACTION ON UPDATE NO ACTION
